import React, { Component } from 'react';
import { connect } from 'react-redux';
import { Link } from 'react-router-dom';

import './nav.css';
import '../float.grid.css';

class Nav extends Component {
  renderContent() {
    switch (this.props.auth) {
      case null:
        return;
      case false:
        return (
          <li id="loginButton"><a href="/auth/google">Login with Google</a></li>
        );
      default:
        return [
          <li><a href="javascript:void(0);" className="icon" onClick="navFunction()"><i className="fa fa-bars"></i></a></li>,
          <li className="navLinks" key="1"><Link to="/">Home</Link></li>,
          // <li key="2"><Link to="/map">Map</Link></li>,
          <li className="navLinks" key="3"><Link to="/meetups">Meetups</Link></li>,
          <li className="navLinks" key="4"><a href="/api/logout">Logout</a></li>
        ];
    }
  }
  render() {
    return (
      <nav>
        {/* <div className="authLink">
          <Link to={this.props.auth ? '/' : '/'}
          >
          StudyBuddy
          </Link> */}
          <ul className="navLinkContainer">
          <li className="authLink">
            <Link to={this.props.auth ? '/' : '/'}
            >
              StudyBuddy
            </Link>
          </li>
            {this.renderContent()}
          </ul>
        {/* </div> */}
      </nav>
    );
  }
}

function navFunction() {
  let x = document.getElementsByClassName("navLinkContainer");
  if (x.className === "navLinks") {
    x.className += " responsive";
  } else {
    x.className = "navLinks";
  }
}

function mapStateToProps({ auth }) {
  return { auth };
}

export default connect(mapStateToProps)(Nav);
